import React from "react";

export const Preview = () => {
  return (
    <section className="preview">
      <div className="container">
        @import
        url('https://fonts.googleapis.com/css2?family=Poppins:wght@100;200;400;500;700&display=swap');
      </div>
    </section>
  );
};
